import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: 1,
      data: new Date(2021, 7, 14),
      title: "Kitchen Tools",
      amount: 70,
    },
    {
      id: 2,
      data: new Date(2021, 9, 14),
      title: "Kitchen Tools",
      amount: 100,
    },
    {
      id: 1,
      data: new Date(2019, 6, 14),
      title: "Kitchen Tools",
      amount: 170,
    },
    {
      id: 1,
      data: new Date(2018, 8, 14),
      title: "Kitchen Tools",
      amount: 190,
    },
  ];

  return (
    <div>
      <ExpenseItem
        tile={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        tile={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        tile={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>

      <ExpenseItem
        tile={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[0].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
